import React from 'react';
import { useFonts } from 'expo-font';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Linking, TouchableOpacity, Image } from 'react-native';
import { Container, Content, SquaresContainer, Square, Lab, ExitContainer, ExitContent } from "./styles/StyleHome";
import Icon from "./icons/fruit.svg";
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome'
import { faRightFromBracket } from "@fortawesome/free-solid-svg-icons";
import { faTag } from "@fortawesome/free-solid-svg-icons";
import { faCommentsDollar } from "@fortawesome/free-solid-svg-icons";


function Home({ navigation }) {
    return (
        <Container>
          <Content>

          <SquaresContainer>
          <Square>
          <FontAwesomeIcon icon={faCommentsDollar} size={ 62 } color={ '#a5acb6' }/>
            <Lab> Pre√ßos </Lab>
          </Square>          
          <Square>
            <Lab> Clientes </Lab>         
          </Square>
          </SquaresContainer>

          <SquaresContainer>
          <Square> 
            <Lab> Atendimento </Lab>       
          </Square>
          <Square>
            <Lab> Vendas </Lab>        
          </Square>
          </SquaresContainer>

          <SquaresContainer>
          <Square>         
            <Lab> Reabertura </Lab>      
          </Square>
          </SquaresContainer>

          </Content>

          <ExitContainer>
            <ExitContent onPress={() => navigation.navigate('Login')}>             
            <FontAwesomeIcon icon={faRightFromBracket} size={ 52 } color={ '#677689' }/>
            </ExitContent>
          </ExitContainer>
        </Container>
    );
  };

  export default Home;
